import React from 'react'

const ContactCard = ({ icon, title, text }) => {
    return (
        <div className="ContactCard">
            {icon}
            <h4 className="ContactCard-title">{title}</h4>
            <h5 className="ContactCard-text">{text}</h5>
        </div>
    )
}

export default ContactCard;
